import React, { lazy } from "react";
//import { Router } from "@reach/router";
import { useSelector, shallowEqual } from "react-redux";
import { Redirect, Route, Switch, withRouter } from "react-router-dom";
import { isEmpty } from "lodash";
import DashboardRoutes from "./pages/home/DashboardRoutes";

const HomePageRoutes = lazy(() => import("./pages/auth/HomePageRoutes"));
const NotFound = lazy(() => import("./pages/404/NotFound"));
const VerifyEmailAlert = lazy(() => import("./pages/auth/VerifyEmailAlert"));
const Logout = lazy(() => import("./pages/auth/Logout"));
const VerifyEmail = lazy(() => import("./pages/auth/VerifyEmail"));
const PostRequirement = lazy(() => import("./pages/post-requirement/Index"));
const ContactDetails = lazy(() =>
  import("./app-components/post-requirement/steps/ContactDetails")
);

function Routes() {
  return (
    <Switch>
      <Route path="/logout" component={Logout} />
      <Route path="/verify-email" component={VerifyEmail} />
      <Route path="/verify-email-alert" component={VerifyEmailAlert} />
      <Route path="/post-requirement" component={PostRequirement} />

      {isEmpty(user) && <HomePageRoutes />}

      {!isEmpty(user) && <DashboardRoutes />}

      <Route component={NotFound} />
    </Switch>
  );
}

export default Routes;
